import { Button, Text } from ".";

const Vin = ({ bg, color, name }) => {
  return (
    <div
      className="w-52 h-72 rounded-lg p-5 relative cursor-pointer"
      style={{
        background: `url(${bg})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    >
      <div className="absolute bottom-4 ">
        <div
          className="w-14 h-2 rounded-xl"
          style={{ background: color }}
        ></div>
        <Text.h4 color={"white"}>{name}</Text.h4>
      </div>
    </div>
  );
};

const Produit = ({ bg, color, type, name, pays, oldPrice, price, link }) => {
  return (
    <div
      className="w-[264px] h-[344px] rounded-lg p-5 cursor-pointer"
      style={{
        background: `url(${bg})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    >
      <div className="flex flex-col">
        <div
          className="w-14 h-2 rounded-xl"
          style={{ background: color }}
        ></div>
        <Text.h4 color={"#5C221E"}>{type}</Text.h4>
        <Text.h2>{name}</Text.h2>
        <Text.p>{pays}</Text.p>
        <Text.p>{oldPrice}</Text.p>
        <Text.price>{price}</Text.price>
        <Button.Primary value={"Acheter"} />
      </div>
    </div>
  );
};

export { Vin, Produit };
